import styled from "styled-components";
import Button from '@mui/material/Button';

const Box = styled.div`
    display: flex;
    align-items: center;
    justify-content: space-between;
    width: 600px;
    margin-left: 500px;
`




function Btn() {

    return(
        <Box>
        <Button src="https://my-json-server.typicode.com/tractian/fake-api" size="small" variant="contained">Modelos</Button>
        <Button size="small" variant="contained">Usuarios</Button>
        <Button size="small"variant="contained">Gráficos</Button>
        </Box>
    )

}

export default Btn;
